import React, { useState } from "react";

function PacketDetection() {
  const [images, setImages] = useState([]);
  const [previews, setPreviews] = useState([]);
  const [results, setResults] = useState([]);

  const handleImageChange = (e) => {
    const files = Array.from(e.target.files);
    setImages(files);
    setPreviews(files.map((file) => URL.createObjectURL(file)));
    setResults([]);
  };

  const handleUpload = async () => {
    const formData = new FormData();
    images.forEach((image) => formData.append("images", image));

    const res = await fetch("http://localhost:5000/packet-upload-multiple", {
      method: "POST",
      body: formData,
    });

    const data = await res.json();

    if (data.results) {
      setResults(data.results);
    }
  };

  return (
    <div className="container mt-4">
      <h2 className="mb-4 text-center">ðŸ“¦ Packet Detection (Multi-image)</h2>

      <div className="mb-3">
        <input
          type="file"
          multiple
          accept="image/*"
          onChange={handleImageChange}
          className="form-control"
        />
      </div>

      {previews.length > 0 && (
        <div className="mb-4">
          <h5>Selected Images:</h5>
          <div className="d-flex flex-wrap gap-3">
            {previews.map((src, i) => (
              <img
                key={i}
                src={src}
                alt={`Preview ${i}`}
                height={150}
                className="rounded shadow"
              />
            ))}
          </div>

          <div className="mt-3">
            <button className="btn btn-primary" onClick={handleUpload}>
              ðŸš€ Upload & Detect
            </button>
          </div>
        </div>
      )}

      {results.length > 0 && (
        <div className="mt-5">
          <h4 className="text-success mb-4">ðŸ§¾ Detection Results</h4>
          <div className="row">
            {results.map((product, i) => (
              <div key={i} className="col-md-6 mb-4">
                <div className="card shadow">
                  <h5 className="card-header">{product.product_name}</h5>
                  <div className="card-body">
                    {product.images.map((image, idx) => (
                      <div key={idx} className="mb-3 text-center">
                        <img
                          src={image.result_url}
                          alt={`Result Image ${idx}`}
                          className="img-fluid rounded shadow"
                          style={{ maxHeight: "200px", objectFit: "contain" }}
                        />
                      </div>
                    ))}

                    <h6 className="text-primary">Extracted Information:</h6>
                    {product.extracted_info.map((infoStr, idx) => {
                      const parsed = safeJSONParse(infoStr);
                      return (
                        <div
                          key={idx}
                          className="border rounded p-3 mb-3 bg-light"
                        >
                          <strong>Image {idx + 1}:</strong>
                          <ul className="mb-0">
                            <li><strong>Ingredient:</strong> {parsed?.ingredient || "N/A"}</li>
                            <li><strong>Total Weight:</strong> {parsed?.total_weight || "N/A"}</li>
                            <li><strong>Expiry Date:</strong> {parsed?.expiry_date || "N/A"}</li>
                          </ul>
                        </div>
                      );
                    })}
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
}

function safeJSONParse(str) {
  try {
    return JSON.parse(str);
  } catch (e) {
    return null;
  }
}

export default PacketDetection;
